import React from 'react'
import {Link} from 'react-router-dom'

const Soda = ({dogs}) => {
    return(
    <>
        <h1>Dog List</h1>
        <h2>{dogs.map(d => d.name )}</h2>
    </>
    )
}

export default Soda;
